import React from 'react'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Boxoffice from './component/Basics/Boxoffice';
import About from './component/Basics/about';
import { BrowserRouter as Router, Route, } from "react-router-dom";


const App = () => {

  return (
    <div className="App">
      <Router>

        <Route path="/" exact Component={() => <Boxoffice />} />
        <Route path="/about" exact Component={() => <About />} />

      </Router>



    </div>
  )
}

export default App;
